// cities
(async ()=>{
    // for each letter in english alphabet
    const neighborhoodIds = [];
    const fetchNeighborhoods = async ({letter, page, hits}) => {
        const res = await fetch("https://wd0ptz13zs-dsn.algolia.net/1/indexes/locations.com/query?x-algolia-agent=Algolia%20for%20JavaScript%20(4.11.0)%3B%20Browser%20(lite)&x-algolia-api-key=cef139620248f1bc328a00fddc7107a6&x-algolia-application-id=WD0PTZ13ZS", {
            "credentials": "omit",
            "headers": {
                "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:121.0) Gecko/20100101 Firefox/121.0",
                "Accept": "*/*",
                "Accept-Language": "en-US,en;q=0.5",
                "content-type": "application/x-www-form-urlencoded",
                "Sec-Fetch-Dest": "empty",
                "Sec-Fetch-Mode": "cors",
                "Sec-Fetch-Site": "cross-site"
            },
            "referrer": "https://dubai.dubizzle.com/",
            "body": `{\"query\":\"${letter}\",\"filters\":\"(type:neighborhood)\",\"facets\":[\"type\"],\"hitsPerPage\":${hits},\"page\":${page}}`,
            "method": "POST",
            "mode": "cors"
        });
        const data = await res.json();
        return data;
    }
    for(let i = 97; i <= 122; i++){
        const letter = String.fromCharCode(i);
        const neighborhoodData = await fetchNeighborhoods({letter, page: 0, hits: 1});
        const {nbHits:total} = neighborhoodData;
        const nbPages = Math.ceil(total / 100);
        for(let page = 0; page < nbPages; page++){
            const {hits} = await fetchNeighborhoods({letter, page, hits: 100});
            // for each get neighborhood id
            hits.map((item)=>{
                neighborhoodIds.push(item.id);
            });
            console.log(`letter: ${letter}; page: ${page}/${nbPages}; count: ${neighborhoodIds.length}`)
        }
        // break;
    }
    console.log([...new Set(neighborhoodIds)]);

})();


